INSERT INTO `fw_tree` VALUES (14,1,26,0,'/','','/','','','','','','','','','1','','','1','1','1',0,0,'',NULL,'1'),(289,10,11,1,'home','<h2>Почему игрушки для детей так важны?</h2>\r\n<p>Чем больше разнообразных игрушек у ребенка, тем сильнее развивается его фантазия, растет кругозор, он быстрее знакомиться с новыми предметами, адаптируется к новым условиям.</p>\r\n<h2>Почему наш интернет магазин детских игрушек?</h2>\r\n<p>Купить детские игрушки можно везде: на улице, в переходах, на рынках, в торговых центрах. Но гарантию на качественный товар вы получите только в крупных розничных сетях, где игрушки стоят достаточно дорого или в интернет магазинах. В отличие от розничных магазинов, наш интернет магазин детских игрушек предлагает заманчиво низкие цены и сертифицированную продукцию.</p>\r\n<p>Вам не придется идти в магазин, чтобы купить детские игрушки. Вам нужно лишь открыть каталог и выбрать понравившиеся игрушки для детей. Если у вас возникли вопросы, можете позвонить нам, мы всегда рады оказать помощь в подборе детских игрушек.</p>\r\n<p>Нашим детям важно разнообразие, они постоянно хотят что-то новое, они не сидят на месте. Мы предлагаем большой выбор игрушек для детей от самого маленького возраста и до подросткового. Купить детские игрушки своим детям значит сделать их счастливее, к тому же, давно доказано, что дети, которые часто играют в игрушки, более развиты, чем их сверстники.</p>','Главная','Shop-Toy - интернет магазин детских игрушек. Купить товары и игрушки для детей вы можете у нас.','','детские игрушки, интернет магазин детских товаров игрушек, купить детские игрушки, товары и игрушки для детей','','page','','<h1>{if $page_content.label}{$page_content.label|strip_tags|stripslashes}{else}{$page_content.name|strip_tags|stripslashes}{/if}</h1>\r\n<div class=\"cattext\">{if $page_content}{eval var=$page_content.text|stripslashes}{/if}</div>\r\n\r\n{$subpages}\r\n\r\n{$documents}','index.html','1','all','all','1','1','0',10,0,'documents_list.html','Интернет магазин детских игрушек и товаров для детей',''),(290,12,13,1,'about_shop','<p>Магазин игрушек &laquo;Shop-toy&raquo; - это обширный выбор товаров для детей по доступным ценам. Мы постоянно работаем над повышением качества обслуживания, мы стремимся к тому, чтобы наши клиенты получали удовольствие при работе с нами.</p>\r\n<p>Проводя регулярные акции и распродажи, мы рекомендуем подписываться на наши рассылки, для того что не упустить шанс купить отличные игрушки по отличным ценам.</p>\r\n<h2>Какие мы хорошие:</h2>\r\n<ul>\r\n<li>Наши цены одни из самых низких на рынке</li>\r\n<li>Весь наш товар сертифицирован</li>\r\n<li>Мы постоянно проводим акции и распродажи</li>\r\n<li>Постоянным клиентам мы дарим постоянные скидки</li>\r\n<li>Мы стараемся быть максимально лояльными к клиентам</li>\r\n<li>Детским учреждениям мы предоставляем существенные скидки</li>\r\n</ul>\r\n<h2>Наши реквизиты:</h2>\r\n<p>ИП Шмиц Андрей Вячеславович<br /> ОГРН 312774628401040<br /> ИНН 772705212026</p>','О магазине','О магазине','','','','page','','<div class=\"text\">\r\n<h1>{$page_content.name|strip_tags|stripslashes}</h1>\r\n\r\n{if $page_content}{eval var=$page_content.text|stripslashes}{/if}\r\n</div>','index.html','1','all','all','1','1','0',10,0,'documents_list.html','О магазине',''),(291,14,15,1,'dostavka','<p>Некоторые наши коллеги, берутся доставлять товар собственными силами, мы - нет.<br />Мы понимаем, что не сможем обеспечить такого уровня комфорта клиентам при доставке, который сможет обеспечить крупная курьерская компания, поэтому мы сотрудничаем с одной такой компанией.</p>\r\n<p>Мы гордимся тем, что постоянно улучшаем условия для клиентов, от подбора товара, до его покупки и доставки.</p>\r\n<p><strong>ВНИМАНИЕ:</strong> Мы осуществляем доставку только в пределах Москвы, не далее 5км за МКАД.</p>\r\n<ul>\r\n<li>Стоимость доставки в пределах МКАД &ndash; 300 рублей</li>\r\n<li>Стоимость доставки за МКАД (не более 5 км.) &ndash; 350 рублей</li>\r\n<li>При заказе на сумму от 5000 руб. &ndash; доставка бесплатно</li>\r\n<li>Заказы от 8кг &ndash;&nbsp;самовывоз или срочная доставка</li>\r\n<li>Самовывоз - бесплатно (Пн-Пт с 10 до 19, Сб с 12 до 17), адрес: г. Москва, Волгоградский проспект, д. 32, корп. 8</li>\r\n</ul>\r\n<p><strong>Срочная доставка</strong> - для вашего удобства мы можем доставить товар (в том числе заказы весом более 8 кг.) в тот же день с 20 до 23 часов - стоимость доставки 400 рублей.</p>\r\n<h2>Пункт самовывоза</h2>\r\n<p>Проезд: станция метро Волгоградский проспект (первый вагон в сторону области), из стеклянных дверей подъем налево.<br /> Идти вдоль волгоградского проспекта до здания с аркой, зайти под арку и идти прямо, справа будет здание (д. 32, корп. 8) с множеством кафе, столовых и прочим, пройти примерно 2/3 здания пока на стеклянных дверях не увидите вывеску \"Курьерская компания МИГ\", зайти внутрь и следовать указателям.</p>','Доставка','Условия доставки','','Условия доставки','Условия доставки товаров магазина SHOP-TOY','page','','<div class=\"text\">\n<h1>{$page_content.name|strip_tags|stripslashes}</h1>\n\n{if $page_content}{eval var=$page_content.text|stripslashes}{/if}\n</div>','index.html','1','all','all','1','1','0',10,0,'documents_list.html','Доставка',''),(292,16,17,1,'skidki','','Скидки','','','','','page','','<h1>{if $page_content.label}{$page_content.label|strip_tags|stripslashes}{else}{$page_content.name|strip_tags|stripslashes}{/if}</h1>\r\n<div class=\"cattext\">{if $page_content}{eval var=$page_content.text|stripslashes}{/if}</div>\r\n\r\n{$subpages}\r\n\r\n{$documents}','index.html','0','all','','1','1','0',10,0,'','Скидки','0'),(294,18,19,1,'contacts','<p>Адрес пункта самовывоза - г. Москва, Волгоградский проспект, д. 32, корп. 8</p>\r\n<p>Пожалуйста, по любым вопросам не стесьняйтесь обращаться:</p>\r\n<p>Телефон: 8 (495) 647-80-53 (операторы работают с 9:00 до 18:00 &mdash; ПН-ПТ)</p>\r\n<p>Email: <a title=\"Организационные вопросы\" href=\"mailto:info@shop-toy.com\">info@shop-toy.com</a>&nbsp;(Организационные вопросы), <a title=\"Технические вопросы\" href=\"mailto:support@shop-toy.com\">support@shop-toy.com</a>&nbsp;(Технические вопросы)</p>','Контакты','Контактная информация для связи с магазином SHOP-TOY','','Контактная информация магазина shop-toy.com','Контактная информация магазина shop-toy.com','page','','<div class=\"text\">\n<h1>{$page_content.name|strip_tags|stripslashes}</h1>\n\n{if $page_content}{eval var=$page_content.text|stripslashes}{/if}\n</div>','index.html','1','all','all','1','1','0',10,0,'documents_list.html','Контакты',''),(295,20,21,1,'catalog','','Каталог','','','','','shop','','{$main}','index.html','1','all','','0','1','0',10,0,'','Каталог','0'),(296,22,23,1,'cabinet','','Личный кабинет','','','','','cabinet','','{$main}','index.html','1','all','','0','1','0',10,0,'','Личный кабинет пользователя','0'),(300,24,25,1,'sitemap','','Карта сайта','','','','','site_map','','','index.html','1','all','','0','1','0',10,0,'','Карта сайта','0');
